description:
Inspired from the famous game,we all know what we bring you something which you always wanted. Flappy Cave Dragons. Flappy cave dragons are trying to escape from the cave of mystry. They cannot do so without ur help,tap the screen to help them give a little push up. Glide their way through the mountains and help them meet their destiny. This is not easy? Ok We know that so we have given some fabulous and exciting power ups.
Shrink dragons will help you shrink ur dragon size,speedy dragon will help you glide swiftly,goden dragon will make u invisible to rocks,shilds give ur dragon an extra force field around them and lot more. Its fun its intrusting and its sooo addictive.
Download and play Flappy Cave Dragons and fall in love with our world.

